import React from 'react';


const ItemsListContainer = (props) => {
        return(
            <div className='ItemsListContainer'>
            <h1>{props.greeting}</h1>
                <ul className='ItemsList'>
                        <li className='Item'>{props.producto1}</li>
                        <li className='Item'>{props.producto2}</li>
                        <li className='Item'>{props.producto3}</li>
                        <li className='Item'>{props.producto4}</li>
                        <li className='Item'>{props.producto5}</li>
                        <li className='Item'>{props.producto6}</li>
                        <li className='Item'>{props.producto7}</li>
                        <li className='Item'>{props.producto8}</li>
                </ul>
            </div>
        )
}

export default ItemsListContainer;
